export const darkBlueText = "#3c5157";
export const shyRed = "#ff4a3d";
export const bgLightBlue = "#def3fa";
export const bgGrayBlue = "#b4bec2";
export const bgSlateBlue = "#233036";

export const gradientBlue =
  "linear-gradient(to right bottom, #def3fa, #dbeff7, #d8ecf3, #d6e8f0, #d3e5ec, #d0e4eb, #cce2ea, #c9e1e9, #c4e1eb, #bfe0ec, #bbe0ee, #b6dff0)";

export const gradientGreen =
  "linear-gradient(to right bottom, #def3fa, #daf1f6, #d7eff2, #d4eced, #d1eae8, #ceeae6, #cbe9e4, #c9e9e1, #c4ebe1, #bfede0, #bbeedf, #b6f0de)";
